window.bookSummaryJSON = "<p>After uncovering the existence of an ancient, secretive organization, Ben must track down its whereabouts to enlist help in a battle for the fate of humanity. He goes behind enemy lines and faces certain danger. He must convince the powerful elites that the looming threat to Alcott is real. </p> <p>If the opposing factions do not put aside their differences and join forces, the fate of mankind may be sealed. With what Ben knows, the solution is obvious. But the murky political waters of Alcott are not easy to navigate. The inexperienced young man from the country will have to act quickly before it is too late for everyone. </p>"; 
